import styled from 'styled-components';

export interface Props {
    srcSet?: string;
}


export const FullBackgroundImageComponent = styled.div<Props>`
    background: url(${(props) => props.srcSet});
    background-size: cover;
    background-position: bottom; 
    height: 100%;

`;
